import logo from './logo.svg';
import './App.css';
import { Component } from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from "react-router-dom";
import Login from './routes/login';

class App extends Component {

  render() {
    return (
      <div>
        <Router>
          <Switch>
            <Route path="/login" >
              <Login/>
            </Route>
          </Switch>
        </Router>
      </div>
    )
  }
}

export default App;
